			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "FRAMEWORK_NAME=\"ObjectBox\"\n\nSCHEME_NAME=\"${FRAMEWORK_NAME}-iOS\"\n\nSIMULATOR_LIBRARY_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${FRAMEWORK_NAME}.framework\"\nDEVICE_LIBRARY_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${FRAMEWORK_NAME}.framework\"\n\nDEVICE_BCSYMBOLMAP_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphoneos\"\n\nDEVICE_DSYM_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${FRAMEWORK_NAME}.framework.dSYM\"\nSIMULATOR_DSYM_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${FRAMEWORK_NAME}.framework.dSYM\"\n\nUNIVERSAL_LIBRARY_DIR=\"${BUILD_DIR}/${CONFIGURATION}-iphoneuniversal\"\nFRAMEWORK=\"${UNIVERSAL_LIBRARY_DIR}/${FRAMEWORK_NAME}.framework\"\n\nOUTPUT_DIR=\"${BUILD_DIR}/${FRAMEWORK_NAME}-iOS-Aggregated.build\"\n\nunset LLVM_TARGET_TRIPLE_SUFFIX\n\n# Simulator build\necho \"Build for Simulator\"\nxcodebuild -project ${PROJECT_NAME}.xcodeproj -scheme ${SCHEME_NAME} -sdk iphonesimulator -configuration ${CONFIGURATION} clean install CONFIGURATION_BUILD_DIR=${BUILD_DIR}/${CONFIGURATION}-iphonesimulator OBJROOT=\"${OBJROOT}/DependentBuilds\" || exit 1\n# Device build\necho \"Build for Device\"\nxcodebuild -project ${PROJECT_NAME}.xcodeproj -scheme ${SCHEME_NAME} -sdk iphoneos -configuration ${CONFIGURATION} install CONFIGURATION_BUILD_DIR=${BUILD_DIR}/${CONFIGURATION}-iphoneos OBJROOT=\"${OBJROOT}/DependentBuilds\" || exit 1\n\n# Create clean aggregate folder\nrm -rf \"${UNIVERSAL_LIBRARY_DIR}\"\nmkdir \"${UNIVERSAL_LIBRARY_DIR}\"\nmkdir \"${FRAMEWORK}\"\nrm -rf \"$OUTPUT_DIR\"\nmkdir -p \"$OUTPUT_DIR\"\n\n# Copy & merge library binaries\necho \"Merge Library\"\ncp -r \"${DEVICE_LIBRARY_PATH}/.\" \"${FRAMEWORK}\"\nlipo \"${SIMULATOR_LIBRARY_PATH}/${FRAMEWORK_NAME}\" \"${DEVICE_LIBRARY_PATH}/${FRAMEWORK_NAME}\" -create -output \"${FRAMEWORK}/${FRAMEWORK_NAME}\" | echo\ncp -r \"${FRAMEWORK}\" \"$OUTPUT_DIR\"\n\n# Merge dSYM\necho \"Merge dSYM\"\nif [ \"${CONFIGURATION}\" == \"Release\" ]; then\n    cp -r \"${DEVICE_DSYM_PATH}\" \"$OUTPUT_DIR\"\n    lipo -create -output \"$OUTPUT_DIR/${FRAMEWORK_NAME}.framework.dSYM/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" \\\n        \"${DEVICE_DSYM_PATH}/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" \\\n        \"${SIMULATOR_DSYM_PATH}/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" || exit 1\n\n    # Copy .bcsymbolmap files & fix some symbols appearing as hidden\n    echo \"Copy .bcsymbolmap files\"\n\n    UUIDs=$(dwarfdump --uuid \"${DEVICE_DSYM_PATH}\" | cut -d ' ' -f2)\n    for file in `find \"${DEVICE_BCSYMBOLMAP_PATH}\" -name \"*.bcsymbolmap\" -type f`; do\n        fileName=$(basename \"$file\" \".bcsymbolmap\")\n        for UUID in $UUIDs; do\n            if [[ \"$UUID\" = \"$fileName\" ]]; then\n                cp -R \"$file\" \"$OUTPUT_DIR\"\n                dsymutil --symbol-map \"$OUTPUT_DIR\"/\"$fileName\".bcsymbolmap \"$OUTPUT_DIR/${FRAMEWORK_NAME}.framework.dSYM\"\n            fi\n        done\n    done\nelse\n    echo \"No need to merge dSYMs for configuration \\\"${CONFIGURATION}\\\".\"\nfi\n\necho \"Finished build script\"\n";
